import './App.css';
import { Routes, Route } from 'react-router-dom';
import HomepageIT from './assets/pages/HomepageIT';


function App() {
  return (
    <>
      <Routes>
        <Route path='/it/' element={<HomepageIT />} />
      </Routes>
    </>
  );
}

export default App;
